var hostSB = new URL(SANDBOX).host.replace(/[:.]/g, '-');
var hostPR = new URL(PR).host.replace(/[:.]/g, '-');
var results = [];
CATEGORIES.forEach(function (cat) {
    var slug = slugifyLabel(cat);
    var sbJson = "cypress/artifacts/effectif/effectif_".concat(hostSB, "_").concat(START, "_").concat(STOP, "_").concat(slug, ".json");
    var prJson = "cypress/artifacts/effectif/effectif_".concat(hostPR, "_").concat(START, "_").concat(STOP, "_").concat(slug, ".json");
    cy.readFile(sbJson, { timeout: 60000 }).then(function (sb) {
        cy.readFile(prJson, { timeout: 60000 }).then(function (pr) {
            var diffs = diffSheetsWithTolerance(sb, pr, 1e-6);
            if (diffs.length) {
                cy.writeFile("cypress/artifacts/effectif/diff_".concat(slug, ".txt"), diffs.join('\n'));
            }
            results.push({ label: cat, diffs: diffs });
        });
    });
});
cy.then(function () {
    var failing = results.filter(function (r) { return r.diffs.length > 0; });
    if (failing.length) {
        var summary = failing.map(function (r) { return "".concat(r.label, ": ").concat(r.diffs.length, " mismatches"); }).join('\n');
        throw new Error("Effectif comparison mismatches:\n".concat(summary, "\nSee cypress/artifacts/effectif/diff_*.txt for details"));
    }
});

